import React from "react";
import "./ModernTemplate.css";

const ModernTemplate = ({ resumeData }) => {
  return (
    <div className="modern-template">
      <header className="modern-header">
        <h1>{resumeData.name}</h1>
        <p className="modern-contact">{resumeData.email}</p>
      </header>

      <section className="modern-skills">
        <h2>Skills</h2>
        <div className="modern-skills-grid">
          {resumeData.skills?.map((skill, index) => (
            <span key={index} className="modern-skill-tag">
              {skill}
            </span>
          ))}
        </div>
      </section>

      <section className="modern-experience">
        <h2>Experience</h2>
        <div className="modern-content">
          {resumeData.experience?.split("\n").map((exp, index) => (
            <p key={index}>{exp}</p>
          ))}
        </div>
      </section>

      <section className="modern-education">
        <h2>Education</h2>
        <div className="modern-content">
          {resumeData.education?.split("\n").map((edu, index) => (
            <p key={index}>{edu}</p>
          ))}
        </div>
      </section>
    </div>
  );
};

export default ModernTemplate;
